import React, {useState} from 'react'
import TodoItem from "./todoItem"

const Todo = () => {
	const [todosData, dataHandler] = useState(
		[
			{
				id: new Date(),
				tite: "text Titel",
				text: "text lorem bla bla"
			},
			{
				id: new Date(),
				tite: "Title",
				text: "lorem and nothing more"
			},
	])

	return (
		<div>
			{
				todosData.map( todoElData =>
					<TodoItem data={todoElData} key={todoElData.id}/>
				)
			}
		</div>
	);
};

export default Todo;
